import styled from "styled-components"

const Title = styled.div`
    color:#4D4ABF;
    font-family: 'NanumSquareOTF', sans-serif;
    font-weight: 800;
    font-size: 1.875em;
`;

const Item = styled.div`
  color:${ props => props.click ? '#4D4ABF': '#FB8500'};
  font-family: 'NanumSquareOTF', sans-serif;
  font-weight: 700;
  font-size: 1.375em;
`

const Category = () => {
    return (
      <Title>Category</Title>
    );
  };


export default Category;
